import React from "react";
import Grid from "@material-ui/core/Grid";

const BookList = ({ books }) => {

	return (
		<Grid container spacing={2} justifyContent="space-evenly" alignItems="baseline">
  			{books.map((book) => (
          <Item>
            <img className="book-cover" src={book.image}/>
      			<p><i>{book.title}</i></p>
            <p>by {book.author}</p>
      			<p>{book.rating}</p>
          </Item>
  			))}
    </Grid>
	);
};

export default BookList;
